import React from "react";
import { animal } from "../../interfaces";
import Animal from "../Animal/Animal"
import Card from "../UI/Card";

interface props {
    animals: animal[]
}

const Animals : React.FC<props> = (props: any) =>  {

    return (
        <Card className="animals">
            {props.items.map((animal: any) =>
                <Animal>
                    key={animal.id}
                    title={animal.title}
                    amout={animal.amout}
                </Animal>
            )}
        </Card>
    );
}

export default Animals
